import React, { Component } from "react";
import {Grid,Box} from '@material-ui/core'
import './style.css';
import { Toolbar } from '@material-ui/core';
function Window(){
    return(  
    <Toolbar>
       <div className="window">
        <div className="formate">
           <button  containerStyle={{padding:10, height:45, overflow:'hidden', 
       borderRadius:50, backgroundColor: 'yellow', border:'green'}}
       style={{fontSize: 20, color: 'orange'}} >
              Add Book  
            </button>
        </div>
        <div className="formate">
           <button  containerStyle={{padding:10, height:45, overflow:'hidden', 
       borderRadius:50, backgroundColor: 'yellow' , border:'green'}}
       style={{fontSize: 20, color: 'blue'}}>
           Edit Book
            </button>
        </div>
        <div className="formate">
           <button containerStyle={{padding:10, height:45, overflow:'hidden',borderRadius:50, 
           backgroundColor: 'yellow' , border:'green'}} style={{fontSize: 20, color: 'red'}}>
          List All Book
            </button>
        </div>   
       </div>
    </Toolbar>
    );
}
export default Window;
